import React from "react";
import {Link} from 'react-scroll';

const NavBar = () => {
    return(
        <div>
            <div>
                <h1>Logo</h1>
            </div>
            <div>
                <Link 
                    to="inicio"
                    smooth= {true}
                    offset={-100}
                    duration={500}>Inicio</Link>
            </div>
        </div>
    )
}

export default NavBar;
